import * as React from 'react';
import {
	Routes,
	Route,
	NavLink,
	Navigate,
	useNavigate,
	useLocation,
} from 'react-router-dom';
import NoMatch from './pages/NoMatch';
import Admin from './pages/Admin';
import Dashboard from './pages/Dashboard';
import { AuthProvider } from './auth/AuthProvider';

const App = () => {
	return (
		<AuthProvider>
			<h1>React Router</h1>

			<Navigation />

			<Routes>
				<Route index element={<Home />} />
				<Route path='home' element={<Home />} />
				<Route
					path='dashboard'
					element={
						<ProtectedRoute>
							<Dashboard />
						</ProtectedRoute>
					}
				/>
				<Route
					path='admin'
					element={
						<ProtectedRoute>
							<Admin />
						</ProtectedRoute>
					}
				/>

				<Route path='*' element={<NoMatch />} />
			</Routes>
		</AuthProvider>
	);
};

export default App;
